import InterestService from '../services/interests.service'

class Interests {

    getAllAvailableInterest = async() => {
        let res = await InterestService.getInterestList();
        let alist = res.data.interests;
        return alist
    }

    getAvailableInterests = (array) => {
        console.log(this.getAllAvailableInterest())
        var list = this.getAllAvailableInterest().filter(function(e) {
            return !(array.includes(e));
        });
        return list;
    }
}

export default new Interests();
